Floofie is an accomplished artist and aspiring animator. Her artistic talent is evident in her pictures, and her sense of style brings a unique feel and character to her work. Smart and educated, she's pursuing a graduate degree, has an in depth knowledge of high fashion, film making, business, Japanese culture, and will admit to the guilty pleasures of comic books and video games.
